import React from "react";
import img01 from '../Assestes/img-1.png'
function Product(){
    return(
        <>
        <div className="product">
            <div className="center-text">
                our products
            </div>
            <div className="items">
                <div className="child">
                    <img src={img01} alt="img01" />
                </div>
            </div>
        </div>
        </>
    )
}

export default Product;
